function MyOwnTable () {

    const data = ["text1", "text2", "text3", "text4", "text5"];

    const map = [
        {
            key1 : "text1",
        },
        {
            key2: "text2",
        },
        {
            key3: "text2",
        },
        {
            key4: "text2",
        }
    ]


    return (
        <table>
            <thead>
                <tr>
                    <th>liczba poczatkowa</th>
                    <th>data one</th>
                    <th>data two</th>
                </tr>
            </thead>
            <tbody>
                {/* {data.forEach(element => {
                    document.body.innerHTML += "<p>" + element + "</p>"
                }) */}
                {data.map((element, index, array) => {
                    return (
                        <tr>
                            <td>{element}</td>
                        </tr>
                    )
                })}

                {map.map((element, index, array) => {
                    console.log(element)
                    return (
                        <tr>
                            <td>{data.length + index}</td>
                            <td>{element.key1}</td>
                            <td>{element.key2}</td>
                            <td>{element.key3}</td>
                            <td>{element.key4}</td>
                        </tr>
                    )
                })}

            </tbody>
        </table>
    )
}


export default MyOwnTable;
